import React, { useState, useEffect } from "react";
import IndexNavbar from "components/Navbars/IndexNavbar.js";
import Footerr from "components/Footers/Footerr";

function MyTickets() {
  const [tickets, setTickets] = useState([]);
  const [selectedTicket, setSelectedTicket] = useState(null);
  const [searchId, setSearchId] = useState("");
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);

  const formatTicketId = (id) => {
    if (!id && id !== 0) return 'ID_INVALIDE';
    const strId = String(id);
    
    // Vérification des erreurs
    if (strId.match(/ERR_/i)) {
      return strId;
    }
    
    try {
      return strId.length > 8 
        ? `${strId.substring(0, 4)}${strId.substring(strId.length - 4)}`
        : strId;
    } catch (e) {
      console.error("Formatage d'ID échoué :", e);
      return strId;
    }
  };

  useEffect(() => {
    document.body.style.margin = "0";
    document.body.style.minHeight = "100vh";
    document.body.style.display = "flex";
    document.body.style.flexDirection = "column";

    const fetchTickets = async () => {
      try {
        const response = await fetch('/api/tickets');
        
        if (!response.ok) {
          throw new Error(`Erreur HTTP ${response.status}`);
        }
        
        const data = await response.json();
        
        // Validation approfondie
        const validatedTickets = data
          .map((ticket, index) => {
            if (!ticket.id || String(ticket.id).startsWith('ERR_')) {
              return {
                ...ticket,
                id: ticket.id || `ERR_NO_ID_${index}_${Date.now()}`
              };
            }
            return ticket;
          })
          .filter(ticket => ticket.sujet && ticket.date);
        
        setTickets(validatedTickets);
        setError(null);

      } catch (err) {
        setError(err.message);
        setTickets([]);
      } finally {
        setIsLoading(false);
      }
    };

    fetchTickets();
  }, []);

  const statusStyles = (statut) => ({
    padding: "0.3rem 0.8rem",
    borderRadius: "4px",
    fontSize: "0.85rem",
    backgroundColor: {
      "Ouvert": "#ffebee",
      "En cours": "#e3f2fd",
      "Résolu": "#e8f5e9",
    }[statut],
    color: {
      "Ouvert": "#c62828",
      "En cours": "#1565c0",
      "Résolu": "#2e7d32",
    }[statut],
    fontWeight: "bold",
  });

  const filteredTickets = tickets.filter(ticket => 
    String(ticket.id).toLowerCase().includes(searchId.toLowerCase())
  );

  return (
    <>
      <IndexNavbar />
      <div style={container}>
        <div style={contentWrapper}>
          <img 
            src="/images/support-banner.jpg" 
            alt="Bannière Support"
            style={bannerImage}
          />
          
          <h1 style={title}>Espace Support Client</h1>
          <p style={subtitle}>Gestion des tickets de support</p>

          {/* Champ de recherche */}
          <div style={searchContainer}>
            <input
              type="text"
              placeholder="Rechercher par référence..."
              value={searchId}
              onChange={(e) => setSearchId(e.target.value)}
              style={searchInput}
            />
          </div>

          {/* Messages d'état */}
          {error && (
            <div style={errorStyle}>
              ⚠️ Erreur de chargement : {error}
            </div>
          )}

          {isLoading ? (
            <div style={loadingStyle}>
              <div className="loader"></div>
              <p>Chargement des tickets...</p>
            </div>
          ) : (
            <div style={ticketGrid}>
              {/* Liste des tickets */}
              <div style={ticketList}>
                {filteredTickets.map((ticket) => (
                  <div 
                    key={ticket.id}
                    style={ticketItem} 
                    onClick={() => setSelectedTicket(ticket)}
                  >
                    <div style={ticketHeader}>
                      <span style={ticketIdStyle(ticket.id)}>
                        {ticket.id.startsWith('ERR_') ? (
                          <>
                            ⚠️ {ticket.id}
                          </>
                        ) : (
                          `#${formatTicketId(ticket.id)}`
                        )}
                      </span>
                      <span style={statusStyles(ticket.statut)}>
                        {ticket.statut}
                      </span>
                    </div>
                    <h3 style={ticketTitle}>{ticket.sujet}</h3>
                    <p style={ticketDate}>
                      {new Date(ticket.date).toLocaleDateString('fr-FR')}
                    </p>
                  </div>
                ))}
                
                {!isLoading && filteredTickets.length === 0 && (
                  <p style={noResultsStyle}>
                    Aucun ticket trouvé{searchId && ` pour "${searchId}"`}
                  </p>
                )}
              </div>

              {/* Détails du ticket */}
              {selectedTicket && (
                <div style={detailsPanel}>
                  <div style={detailsHeader}>
                    <h2 style={detailsTitle}>
                      {selectedTicket.id.startsWith('ERR_') ? (
                        <span style={{ color: "#c62828" }}>
                          ⚠️ Ticket Erroné
                        </span>
                      ) : (
                        "Détails du ticket"
                      )}
                    </h2>
                    <button 
                      style={closeButton} 
                      onClick={() => setSelectedTicket(null)}
                    >
                      ×
                    </button>
                  </div>
                  
                  <div style={detailsContent}>
                    <div style={detailRow}>
                      <span style={detailLabel}>Référence :</span>
                      <span style={ticketIdStyle(selectedTicket.id)}>
                        {selectedTicket.id.startsWith('ERR_') ? (
                          selectedTicket.id
                        ) : (
                          `#${formatTicketId(selectedTicket.id)}`
                        )}
                      </span>
                    </div>
                    
                    {/* ... (autres détails identiques) ... */}
                  </div>
                </div>
              )}
            </div>
          )}
        </div>
      </div>
      <Footerr />
    </>
  );
}

const container = {
  flex: 1,
  display: "flex",
  alignItems: "center",
  justifyContent: "center",
  padding: "2rem",
  backgroundColor: "#f4f6f8"
};

const contentWrapper = { 
  width: "100%", 
  maxWidth: "800px" 
};

const bannerImage = {
  width: "100%",
  maxHeight: "200px",
  borderRadius: "12px",
  objectFit: "cover",
  marginBottom: "1rem",
  boxShadow: "0 4px 10px rgba(0,0,0,0.1)"
};

const title = {
  color: "#1a237e",
  fontSize: "2.5rem",
  textAlign: "center",
  marginBottom: "1rem",
  marginTop: "4rem",
  fontWeight: "bold",
  textShadow: "1px 1px 2px rgba(0, 0, 0, 0.1)",
  borderBottom: "3px solid #c5cae9",
  paddingBottom: "0.5rem",
  letterSpacing: "1px"
};

const subtitle = { 
  textAlign: "center", 
  color: "#555", 
  marginBottom: "2rem" 
};

const ticketGrid = { 
  display: "grid", 
  gap: "2rem", 
  gridTemplateColumns: "1fr" 
};

const ticketList = { 
  backgroundColor: "#f8f9fa", 
  borderRadius: "8px", 
  padding: "1rem" 
};

const ticketItem = {
  backgroundColor: "white",
  borderRadius: "6px",
  padding: "1rem",
  marginBottom: "1rem",
  cursor: "pointer",
  border: "1px solid #eee",
  transition: "all 0.3s"
};

const ticketHeader = { 
  display: "flex", 
  justifyContent: "space-between", 
  alignItems: "center", 
  marginBottom: "0.5rem" 
};

const ticketId = { 
  color: "#666", 
  fontSize: "0.9rem" 
};

const ticketTitle = { 
  fontSize: "1.1rem", 
  color: "#333", 
  margin: "0 0 0.5rem 0" 
};

const ticketDate = { 
  color: "#999", 
  fontSize: "0.85rem", 
  margin: "0" 
};

const detailsPanel = { 
  backgroundColor: "white", 
  borderRadius: "8px", 
  padding: "1.5rem", 
  border: "1px solid #eee" 
};

const detailsHeader = { 
  display: "flex", 
  justifyContent: "space-between", 
  alignItems: "center", 
  marginBottom: "1.5rem" 
};

const detailsTitle = { 
  fontSize: "1.5rem", 
  color: "#1a237e", 
  margin: "0" 
};

const closeButton = {
  background: "none",
  border: "none",
  fontSize: "1.5rem",
  color: "#666",
  cursor: "pointer",
  padding: "0 0.5rem"
};

const detailsContent = { 
  lineHeight: "1.6" 
};

const detailRow = {
  display: "flex",
  justifyContent: "space-between",
  marginBottom: "1rem",
  paddingBottom: "1rem",
  borderBottom: "1px solid #eee"
};

const detailLabel = { 
  color: "#666", 
  fontWeight: "bold", 
  marginRight: "1rem" 
};

const detailDescription = { 
  marginTop: "2rem" 
};

export default MyTickets;
